  var url_oferta_cir = '../../../src/CirculacionNidos/Controlador/OfertaCirculacionController.php';

  /*-----------------CARGAR ENCABEZADO DEL REPORTE-----------------------*/
  function cargarDatosEventoReporte(idEvento) {
    var mostrar;
    var datos = {
      funcion: 'consultarDatosEventoReporte',
      'p1': idEvento
    };
    $.ajax({
      url: url_oferta_cir,
      type: 'POST',
      data: datos,
      dataType: 'json',
      success: function(data) {
        mostrar = data[0];
      },
      async: false
    });
    return mostrar;
  }

  /*-----------------CARGAR ENCABEZADO DEL REPORTE-----------------------*/
  function cargarEquiposReporte(idEvento) {
    var mostrar;
    var datos = {
      funcion: 'consultarEquiposReporte',
      'p1': idEvento
    };
    $.ajax({
      url: url_oferta_cir,
      type: 'POST',
      data: datos,
      dataType: 'json',
      success: function(data) {
        mostrar = data;
      },
      async: false
    });
    return mostrar;
  }


  function procesarInfoPDFInforme(idEvento) {
    var datosPDF = cargarDatosEventoReporte(idEvento);
    var equipos = cargarEquiposReporte(idEvento);

    datosPDF.equiposTabla = [];

    datosPDF.equiposTabla.push(
      [{text:'EQUIPOS',style: 'titletabla'},
      {text:'ARTISTAS COMUNITARIOS',style: 'titletabla'},
      {text:'SINOPSIS',style: 'titletabla'}],
      );

    equipos.forEach(function(value) {
      datosPDF.equiposTabla.push([{text:value.EQUIPO,style: 'campos'},{text:value.ARTISTAS,style: 'campos'},{text:value.DESCRIPCION,style: 'campos'}],);
    }); 
    descargarPDFInforme(datosPDF);
  }


